import {useState, useEffect} from 'react';

import axios from "axios";

export const useName = () => {


	const [name, setName] = useState([])

	useEffect(() => {
		axios.get("api.namefake.com")
			.then(res => {
				console.log(res)
				setName(name)
			})
	}, [])
	return {name}
}
